import React from "react";

const UsersList = ({ onMakeUser }) => {
  return (
    <>
      <ul>
        {onMakeUser.map((user) => (
          <li key={user.id}>
            {user.userName} {user.password}
          </li>
        ))}
      </ul>
    </>
  );
};

export default UsersList;
